// --- acr_ed.FDb.targsrc.qFind
// 'quick' Access row by row id. No bounds checking.
inline acr_ed::FTargsrc& acr_ed::targsrc_qFind(u64 t) {
    u64 x = t + 1;
    u64 bsr   = algo::u64_BitScanReverse(x);
    u64 base  = u64(1)<<bsr;
    u64 index = x-base;
    return _db.targsrc_lary[bsr][index];
}

